changeGridsDesc,"Configure tile and frame grid overlays using pixels of the original image for size and pixels of the rendered image for thickness","Configurar superposiciones de cuadrícula de mosaicos y marcos utilizando píxeles de la imagen original para el tamaño y píxeles de la imagen renderizada para el grosor","Configurar superposiciones de cuadrícula de mosaicos y marcos utilizando píxeles de la imagen original para el tamaño y píxeles de la imagen renderizada para el grosor","Configura les superposicions de graella de rajoles i marcs utilitzant píxels de la imatge original per a la mida i píxels de la imatge renderitzada per al gruix","配置瓦片和框架网格叠加，使用原始图像的像素进行大小调整，并使用渲染图像的像素进行厚度调整","配置圖塊和框架網格疊加，使用原始圖像的像素進行大小設定，並使用渲染圖像的像素進行厚度設定","タイルとフレームのグリッドオーバーレイを設定し、サイズには元の画像のピクセルを使用し、レンダリングされた画像のピクセルを厚さとして使用します","Configura le sovrapposizioni della griglia di tessere e cornici utilizzando i pixel dell'immagine originale per la dimensione e i pixel dell'immagine renderizzata per lo spessore","Konfigurieren Sie Kachel- und Rahmenrasterüberlagerungen unter Verwendung von Pixeln des Originalbilds für die Größe und Pixeln des gerenderten Bilds für die Dicke","Configurer les superpositions de grille de tuiles et de cadres en utilisant les pixels de l'image originale pour la taille et les pixels de l'image rendue pour l'épaisseur","Configure as sobreposições de grade de ladrilhos e quadros usando pixels da imagem original para o tamanho e pixels da imagem renderizada para a espessura","Настройте наложения сетки плитки и рамки, используя пиксели исходного изображения для размера и пиксели отрисованного изображения для толщины","Configure as sobreposições de grade de ladrilhos e quadros usando pixels da imagem original para o tamanho e pixels da imagem renderizada para a espessura","Skonfiguruj nakładki siatki kafelków i ramek, używając pikseli oryginalnego obrazu do rozmiaru i pikseli wyrenderowanego obrazu do grubości","Kiremit ve çerçeve ızgara örtülerini yapılandırın, boyut için orijinal görüntü piksellerini ve kalınlık için işlenmiş görüntü piksellerini kullanarak","Konfiguratu mosaiko eta marko sareta gainjartzeak, jatorrizko irudiaren pixelak tamainarako eta errendatutako irudiaren pixelak lodierarako erabiliz","Configurar las superposicions de reticle de tauleta e de quadre utilizant los pixèls de l'imatge originala per la talha e los pixèls de l'imatge renduda per l'espessor","ตั้งค่าการซ้อนทับกริดกระเบื้องและเฟรมโดยใช้พิกเซลของภาพต้นฉบับสำหรับขนาดและพิกเซลของภาพที่เรนเดอร์สำหรับความหนา","타일과 프레임 그리드 오버레이를 구성하며, 크기는 원본 이미지의 픽셀을 사용하고, 두께는 렌더링된 이미지의 픽셀을 사용합니다","Nastavte překryvy mřížky dlaždic a rámů pomocí pixelů původního obrázku pro velikost a pixelů vykresleného obrázku pro tloušťku"
